import React from 'react';
import styled from 'styled-components';


const Page = styled.div`
  width:100%;
  height:100%;
  position:absolute;
  right:90%;
  background-color:red;
`

function MissReflections(props){

  return (
    <Page>miss reflections</Page>
  )

}


export default MissReflections;
